import React from 'react';
import { Component } from 'react';
import { Button, Form, FormGroup, Label, Input, FormText } from 'reactstrap';
import './App.css';

class Login extends Component {

  constructor() {
    super();
    this.state = {
      email: '',
      password: ''
    };
    this.handleChange = this.handleChange.bind(this);
  }

  handleChange(evt) {
    // check it out: we get the evt.target.name (which will be either "email" or "password")
    // and use it to target the key on our `state` object with the same name, using bracket syntax
    this.setState({ [evt.target.name]: evt.target.value });
  }

  render() {
    return (
      <form>
        <FormGroup>
          <label>StakedTokens</label>
          <input type="number" name="Stake tokens" value="1000" onChange={this.handleChange} />
        </FormGroup>

        <FormGroup>
          <label>LitPrice</label>
          <input type="number" name="nordicenergy token Price" value="0.1" onChange={this.handleChange} />
        </FormGroup>

        <FormGroup>
          <label>AverageNumberOfTx</label>
          <input type="number" name="Average Number of tx" value="80000" onChange={this.handleChange} />
        </FormGroup>

        <FormGroup>
          <label>TxCost</label>
          <input type="number" name="Tx cost" value="0.01" onChange={this.handleChange} />
        </FormGroup>
        <FormGroup>
          <label>IsGenesisPhase</label>
          <input type="checkbox" name="Is genesis phase" onChange={this.handleChange} />
        </FormGroup>
      </form>
    );
  }
}


function App() {
  return (new Login()
    /*
    <div className="App">
      <header className="App-header">
        <img src={logo} className="App-logo" alt="logo" />
        <p>
          Edit <code>src/App.js</code> and save to reload.
        </p>
        <a
          className="App-link"
          href="https://reactjs.org"
          target="_blank"
          rel="noopener noreferrer"
        >
          Learn React
        </a>
      </header>
    </div>
    */
  );
}

export default App;
